import React from "react";
import { Task } from "./task.class";

const TaskComponent = ({ task }) => {
  return (
    <div>
      <tr>
        <td>{task.titulo}</td>
        <td>{task.descripcion}</td>
        <td>
          Aqui debo llamar un icono un estilo para la letra dependiendo del
          LEVEL
        </td>
        <td>ICONOS</td>
      </tr>
    </div>
  );
};

export default TaskComponent;
